import Navbar from "../../components/navbar/Navbar";

function Home() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((res) => {
        if (res.error) {
          if (res.error === 1) {
            // setData((loginScreen))
          }
        }
      })
      .then((data) => setData(data.message));
  }, []);

  return (
    <>
      <Navbar />
    </>
  );
}

export default Home;
